import React from "react";
import styled from "styled-components";
import { LIElement, ULElement } from "../Header/style";
import Logo from "../Logo/index";
import { Link } from "react-router-dom";

const HeaderContainer = styled.header`
  width: 100%;
  height: 100%;
`;

const LogoContainer = styled.div`
  display: flex;
  padding: 7px;
  display: flex;
  align-items: center;
`;

const ListContainer = styled.div`
  margin-left: 15px;
`;

const LinlContainer = styled(Link)`
  color: red;
`;

function Index() {
  return (
    <>
      <HeaderContainer>
        <LogoContainer>
          <Logo />
          <ListContainer>
            <ULElement>
              <Link to="">
                <LIElement>Home</LIElement>
              </Link>
              <LIElement>
                <Link to="">Contact</Link>
              </LIElement>
              <LIElement>
                <Link to="">tra</Link>
              </LIElement>
            </ULElement>
          </ListContainer>
        </LogoContainer>
      </HeaderContainer>
    </>
  );
}

export default Index;
